import React, { useState, useEffect } from "react";
import ErrorBoundary from "./ErrorBoundary";
import "./StocksPage.css";
import {
  StockChartComponent,
  StockChartSeriesCollectionDirective,
  StockChartSeriesDirective,
  StockChartIndicatorsDirective,
  StockChartIndicatorDirective,
  Inject,
  DateTime,
  Tooltip,
  RangeTooltip,
  Crosshair,
  LineSeries,
  CandleSeries,
  Legend,
  Export,
  EmaIndicator,
  TmaIndicator,
  SmaIndicator,
  MomentumIndicator,
  AtrIndicator,
  AccumulationDistributionIndicator,
  BollingerBands,
  MacdIndicator,
  StochasticIndicator,
  RsiIndicator,
} from "@syncfusion/ej2-react-charts";

const StocksPage = () => {
  const [ticker, setTicker] = useState("");
  const [selectedTicker, setSelectedTicker] = useState("AAPL");
  const [chartData, setChartData] = useState([]);
  const [error, setError] = useState("");
  const [selectedIndicator, setSelectedIndicator] = useState("Ema");

  const indicatorTypes = [
    { value: "Ema", label: "EMA" },
    { value: "Sma", label: "SMA" },
    { value: "Tma", label: "TMA" },
    { value: "Rsi", label: "RSI" },
    { value: "Momentum", label: "Momentum" },
    { value: "Macd", label: "MACD" },
    { value: "Stochastic", label: "Stochastic" },
    { value: "BollingerBands", label: "Bollinger Bands" },
  ];

  const fetchChartData = async (tickerSymbol) => {
    try {
      const response = await fetch(
        `http://localhost:5000/api/candlestick?ticker=${tickerSymbol}`
      );
      const data = await response.json();
      if (data.dates) {
        const formattedData = data.dates.map((date, index) => ({
          x: new Date(date),
          open: data.open[index],
          high: data.high[index],
          low: data.low[index],
          close: data.close[index],
        }));
        setChartData(formattedData);
        setError("");
      } else {
        setChartData([]);
        setError("No data available for the selected ticker.");
      }
    } catch (err) {
      console.error("Error fetching chart data:", err);
      setError("Failed to load chart data.");
    }
  };

  useEffect(() => {
    fetchChartData(selectedTicker);
  }, [selectedTicker]);

  const handleSearch = () => {
    if (ticker.trim() !== "") {
      setSelectedTicker(ticker.toUpperCase());
    }
  };

  return (
    <div className="stocks-page">
      <h2>{selectedTicker} Stock Analysis</h2>
      <div>
        <input
          type="text"
          placeholder="Enter stock ticker"
          value={ticker}
          onChange={(e) => setTicker(e.target.value)}
        />
        <button onClick={handleSearch}>Search</button>
      </div>
      <div>
        {error ? (
          <p style={{ color: "red" }}>{error}</p>
        ) : (
          <ErrorBoundary>
            <StockChartComponent
              primaryXAxis={{ valueType: "DateTime" }}
              primaryYAxis={{ labelFormat: "${value}" }}
              legendSettings={{
                visible: true,
                position: "Bottom",
                alignment: "Center",
              }}
            >
              <Inject
                services={[
                  CandleSeries,
                  Legend,
                  DateTime,
                  Tooltip,
                  EmaIndicator,
                  SmaIndicator,
                  RsiIndicator,
                ]}
              />
              <StockChartSeriesCollectionDirective>
                <StockChartSeriesDirective
                  dataSource={chartData}
                  xName="x"
                  open="open"
                  close="close"
                  high="high"
                  low="low"
                  type="Candle"
                />
              </StockChartSeriesCollectionDirective>
              <StockChartIndicatorsDirective>
                <StockChartIndicatorDirective
                  type={selectedIndicator}
                  field="Close"
                  seriesName={selectedTicker}
                  xName="x"
                  open="open"
                  high="high"
                  low="low"
                  close="close"
                  fill="#606eff"
                  period={14}
                />
              </StockChartIndicatorsDirective>
            </StockChartComponent>
          </ErrorBoundary>
        )}
      </div>
    </div>
  );
};

export default StocksPage;
